import React from 'react';
import RunLog from './RunLog';

export default function RunInfo(props) {
	return (
		<div className="runInfo">
			<h5>{props.runLogs.length} Run{props.runLogs.length > 0 ? "s" : ""} Logged</h5>

			{props.runLogs.length===0 && !props.loading ? (
				<div>
					Log your first run!
				</div>
			) : null}
			{props.runLogs.map((runLog,index)=> (
				<RunLog key={index} log={runLog} />
			))}
		</div>
	);
}
